import { useParams } from "react-router-dom";

function Details() {
  // Get the ID from the URL
  const { id } = useParams();

  return (
    <div>
      <h1>Todo Details</h1>
      <p>ID: {id}</p> 
    </div>
  );
}

export default Details;
